import React from "react";
import App from "../App";
import FishCard from "../components/Modules/FishCard";
import {useParams} from 'react-router-dom'
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import AppNavBar from "../components/Layouts/AppNavBar";
import Availability from "../components/Modules/Availability";
function Fish(props){

    console.log( 'ss', props.object.state.getQuery('id'));
    //props.object.setState({})
    let key=props.object.state.getQuery('id');
    let fish=props.object.state.allFish.filter(ele=>ele.id==key)[0];
    return (
        <section>
            <header>
                <AppNavBar></AppNavBar>   
            </header>
            <article>
            <Container maxWidth='90vw'>
                <Box sx={{ bgcolor: '#cfe8fc', height: '100vh' }}>         
                    <Box sx={{ bgcolor: '#cfe8fc', height: '40vh', width: '40%',backgroundColor:'red' }}>
                        {fish?(<FishCard fish={fish} width='100%' height='100%'></FishCard>):(<></>)}
                    </Box>
                    <Box sx={{ bgcolor: '#cfe8fc', height: '40vh', width: '50%',backgroundColor:'red' }}>
                        <Availability></Availability>
                     </Box>
                </Box>

            </Container>
            </article>
        </section>
    );
}

export default Fish;
